 * Creates a new {@link FieldInfo} instance from the given instance. If the given instance is
 * read-only this instance will be read-only too.
 * 
 * @see #isReadOnly()
 */
FieldInfos(FieldInfos other) {
  this(other.globalFieldNumbers);
}

/**
 * Creates a new {@link FieldInfo} instance from the given instance. If the given instance is
 * read-only this instance will be read-only too.
